import algorithms.BurrowsWheelerTransform
import org.junit.jupiter.api.BeforeEach
import org.junit.jupiter.api.DisplayName
import org.junit.jupiter.api.Test
import kotlin.test.assertEquals

internal class S09C10P08BurrowsWheelerMatchingTest {

    lateinit var bwt: BurrowsWheelerTransform

    @BeforeEach
    fun setUp() {
        bwt = BurrowsWheelerTransform()
    }
    /**
     *  Pattern Matching with the Burrows-Wheeler Transform
     * Stepik: https://stepik.org/lesson/240383/step/8?unit=212729
     * Rosalind: https://rosalind.info/problems/ba9l/
     *
     * Finding the Matched Patterns (7/10)
     * https://www.youtube.com/watch?v=gUK2JvCCUio
     *
     * Setting Up Checkpoints (8/10)
     * https://www.youtube.com/watch?v=byNR4CbYiPQ
     *
     * See also:
     * https://en.wikipedia.org/wiki/Burrows%E2%80%93Wheeler_transform
     *
     * Compute Burrows-Wheeler Transform Written by Bernhard Haubold
     * http://guanine.evolbio.mpg.de/cgi-bin/bwt/bwt.cgi.pl
     */


    /**
    9.10 Pattern Matching with the Burrows-Wheeler Transform
    Code Challenge: Implement BWMatching.

    Input: A string BWT(Text), followed by a space-separated collection of Patterns.

    Output: A space-separated list of integers, where the i-th integer
    corresponds to the number of substring matches of the i-th member of Patterns in Text.

     */

    @Test
    @DisplayName("Burrows Wheeler Matching Sample Test")
    fun burrowsWheelerMatchingSampleTest() {

        val sampleInput = "GGTTCACAAGCGAGTTCATATACTAATACCTCTTCCTGACTCCATCAACT$"
        val encodedInput = "TCCTCTATGAGATCCTATTCTATGAAACCTTCA\$GACCAAAATTCTCCGGC"
        val e = bwt.bwtEncode(sampleInput)
        assertEquals(encodedInput, e)
        val d = bwt.bwtDecode(e)
        assertEquals(d, sampleInput)

        val symbols = "CCT CAC GAG CAG ATC"
        val result = bwt.burrowsWheelerMatchingMultiple(symbols.split(" "))

        //println(result.joinToString(" "))
        val expectedResult = "2 1 1 0 1"

        assertEquals(expectedResult, result.joinToString(" "))

    }


    @Test
    @DisplayName("Burrows Wheeler Matching Very Simple Test")
    fun burrowsWheelerMatchingVerySimpleTest() {

        val sampleInput = "ABCABD$"
        val encodedInput = "D\$CAABB"
        val e = bwt.bwtEncode(sampleInput)
        assertEquals(encodedInput, e)
        val d = bwt.bwtDecode(e)
        assertEquals(d, sampleInput)

        val result = bwt.burrowsWheelerMatching("AB")
        assertEquals(2, result)
    }

    @Test
    @DisplayName("Burrows Wheeler Matching Very Simple2 Test")
    fun burrowsWheelerMatchingVerySimple2Test() {

        val sampleInput = "ABCDEF$"
        val encodedInput = "F\$ABCDE"
        val e = bwt.bwtEncode(sampleInput)
        assertEquals(encodedInput, e)
        val d = bwt.bwtDecode(e)
        assertEquals(d, sampleInput)

        val result = bwt.burrowsWheelerMatching("ABCDEF")
        assertEquals(1, result)
    }

    @Test
    @DisplayName("Burrows Wheeler Matching Very Simple3 Test")
    fun burrowsWheelerMatchingVerySimple3Test() {

        val sampleInput = "ABABAB$"
        val encodedInput = "BBB\$AAA"
        val e = bwt.bwtEncode(sampleInput)
        assertEquals(encodedInput, e)
        val d = bwt.bwtDecode(e)
        assertEquals(d, sampleInput)

        val result = bwt.burrowsWheelerMatching("AB")
        assertEquals(3, result)
    }

    @Test
    @DisplayName("Burrows Wheeler Matching Very Simple4 Test")
    fun burrowsWheelerMatchingVerySimple4Test() {

        val sampleInput = "AAAABBBBB$"
        val encodedInput = "B\$AAABBBBA"
        val e = bwt.bwtEncode(sampleInput)
        assertEquals(encodedInput, e)
        val d = bwt.bwtDecode(e)
        assertEquals(d, sampleInput)

        val result = bwt.burrowsWheelerMatching("AB")
        assertEquals(1, result)
    }

